import React from "react";

const Dashbord = () => {
    return (
        <>
            <nav class="db dt-l w-100 border-box pa3 ph5-l bg-green">
                <a class="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l" href="#" title="Home">
                    <img src="https://www.wikipedia.org/portal/wikipedia.org/assets/img/Wikipedia-logo-v2.png" class="dib w2 h2 br-100" alt="Site Name" />
                </a>
                
            </nav>

        </>
    );
}

export default Dashbord;
